void SaveLastShape()
{
   CFileDialog dlg(FALSE, "cpp");
   dlg.m_ofn.lpstrFilter = "*.cpp\0*.cpp\0\0";
   if(dlg.DoModal()==IDOK)
   {
      CString strFileName = dlg.GetPathName();
      CString sName = dlg.GetFileTitle();
      CFile file(strFileName, CFile::modeWrite | CFile::modeCreate);
      CString strLine;
      strLine.Format("extern SHAPE Shape%s;\r\n", sName);
      file.Write((LPVOID)(LPCSTR)strLine, strLine.GetLength());
      strLine.Format("DPOINT %sVertext[] = {\r\n", sName);
      file.Write((LPVOID)(LPCSTR)strLine, strLine.GetLength());
      strLine = "";
      for(int i=0; i<g_NewShape.iVertexCount; i++)
      {
         if(strLine.GetLength()>200)
         {
            strLine += "\r\n";
            file.Write((LPVOID)(LPCSTR)strLine, strLine.GetLength());
            strLine = "";
         }
         CString s;
         s.Format("{%f,%f},", g_NewShape.aVertex[i].x, g_NewShape.aVertex[i].y);
         strLine+=s;
      }
      strLine += "\r\n";
      file.Write((LPVOID)(LPCSTR)strLine, strLine.GetLength());
      strLine.Format("}; SHAPE Shape%s = {%i, (CDPOINT*)%sVertext};\r\n", sName, g_NewShape.iVertexCount, sName);
      file.Write((LPVOID)(LPCSTR)strLine, strLine.GetLength());
   }
}

void ReadNewShape()
{
   if(g_NewShape.aVertex!=NULL)
   {
      if(AfxMessageBox("Save Last Shape?",MB_OKCANCEL)==IDOK)
         SaveLastShape();
      delete []g_NewShape.aVertex;
   }

   CFileDialog dlg(TRUE, "ASE");
   dlg.m_ofn.lpstrFilter = "*.ASE\0*.ASE\0\0";
   if(dlg.DoModal()==IDOK)
   {
      CString strFileName = dlg.GetPathName();
      CFile file(strFileName, CFile::modeRead);
      DWORD dwLen = file.GetLength();
      char* lpData = new char[dwLen];
      file.Read(lpData, dwLen);
      char* lpLine = strtok(lpData, "\n");
      BOOL bNumOfVertsFound = FALSE;
      int iCurPoint = 0;
      while(lpLine != NULL)
      {
         CString strLine(lpLine);
         if(!bNumOfVertsFound && ClearFromStr(strLine, "		*SHAPE_VERTEXCOUNT"))
         {
            strLine.TrimLeft(); strLine.TrimRight();
            bNumOfVertsFound = TRUE;
            g_NewShape.iVertexCount = atoi((LPSTR)(LPCSTR)strLine);
            g_NewShape.aVertex = new CDPOINT[g_NewShape.iVertexCount];
         }
         else if(bNumOfVertsFound && strLine.Find("}")>=0)
         {
            break;
         }
         else if(bNumOfVertsFound)
         {
            CString strWord = GetWordFromStr(strLine);//*SHAPE_VERTEX_KNOT
            strWord = GetWordFromStr(strLine);//0
            strWord = GetWordFromStr(strLine);//x
            g_NewShape.aVertex[iCurPoint].x = atof(strWord);
            strWord = GetWordFromStr(strLine);//y
            g_NewShape.aVertex[iCurPoint].y = atof(strWord);
            iCurPoint++;
         }

         lpLine = strtok(NULL, "\n");
      }

      delete []lpData;
   }
}

LPSHAPE GetLastShape(){return &g_NewShape;}

